import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import ToDoList from './components/ToDoList';
import axios from 'axios';

class App extends Component {
  constructor(){
    super()
      this.state ={
        myList : []
      }

  }


componentDidMount (){

  axios.get('/api/toDoList').then((res)=>{

    console.log(res.data,'jhghgh')

    this.setState({
      myList :res.data
    })
  })
}


  render() {

   let toDoList = this.state.myList.map((name, i)=>{
     return (
       <li key = {i} > {name} </li>
     )
   })

    return (
      <div className="App">
       <ToDoList  todolist = {toDoList} />
      </div>
    );
  }
}

export default App;
